export default function getSearch(string, listToRender, profileData) {
  let temp = {}

  listToRender.forEach((listItem) => {
    listItem = listItem.toLowerCase()
    let returnedList = []
    let currentList = []

    let test = new Worker("getDeviceData.js")

    test.onmessage = function(e) {
      // data = e.data
      console.log(e.data)
    }

      //TRY SWITCH FOR SPEED

    profileData[listItem.toLowerCase()]?.forEach(value => {
      value.slice(1, Object.keys(value).at(-1)).forEach((item, i) => { //TRY FOR LOOP HERE TO BREAK
        if (item.data.toLowerCase().includes(string.target.value.toLowerCase()) && !currentList.includes(value[0]['key'])) {
          currentList.push(value[0]['key'])
          returnedList.push(value)
        }
      })
    })
    temp[listItem.toLowerCase()] = returnedList
  })

  return temp
}
